        <script>
        document.addEventListener("DOMContentLoaded", function() {
            window.MAP = map_43cea9bb47d9a9d8a4005397d94870a8;
            var STREETS = [{"name": "Achenbachstr", "mid": [51.2655385, 7.123865]}, {"name": "Alfred-Nobel-Str", "mid": [51.2741215, 7.120054]}, {"name": "Am Eckbusch", "mid": [51.2767408, 7.1051227]}, {"name": "Am Eigenbach", "mid": [51.2823463, 7.1160043]}, {"name": "Am Hochsitz", "mid": [51.2811224, 7.1173351]}, {"name": "Am Jagdhaus", "mid": [51.2800985, 7.1160537]}, {"name": "Am Luhnberg", "mid": [51.2751669, 7.1216809]}, {"name": "Am Ringelbusch", "mid": [51.278053, 7.1059632]}, {"name": "Am Rohm", "mid": [51.2764184, 7.1120801]}, {"name": "Ausblick", "mid": [51.2812776, 7.1143347]}, {"name": "Bergischer Ring", "mid": [51.2734223, 7.1202383]}, {"name": "Birkenh\u00f6he", "mid": [51.2789753, 7.1127882]}, {"name": "Borsigstr", "mid": [51.2694412, 7.1253623]}, {"name": "Boschstr", "mid": [51.2723301, 7.1233747]}, {"name": "B\u00f6cklinstr", "mid": [51.2670895, 7.1231871]}, {"name": "D\u00f6ringstr", "mid": [51.2512393, 7.1043134]}, {"name": "Egenstr", "mid": [51.2707381, 7.1179542]}, {"name": "Farnweg", "mid": [51.2795213, 7.1105023]}, {"name": "In der H\u00fclsbeck", "mid": [51.2654904, 7.1277654]}, {"name": "Jagdhausweg", "mid": [51.2800393, 7.121551]}, {"name": "Kaulbachstr", "mid": [51.2663807, 7.1268649]}, {"name": "Kruppstr", "mid": [51.2712938, 7.123228]}, {"name": "Lenbachstr", "mid": [51.2673811, 7.1258995]}, {"name": "Lipkenskothen", "mid": [51.2786161, 7.1120441]}, {"name": "Mannesmannstr", "mid": [51.2667982, 7.1286879]}, {"name": "Menzelstr", "mid": [51.2664443, 7.1237615]}, {"name": "Moospfad", "mid": [51.2811272, 7.1080762]}, {"name": "Nevigeser Str", "mid": [51.2864903, 7.1105368]}, {"name": "Oberd\u00fcsseler Weg", "mid": [51.2817564, 7.1003549]}, {"name": "Paul-Ehrlich-Str", "mid": [51.2752302, 7.1132885]}, {"name": "Pirschgang", "mid": [51.2796536, 7.120501]}, {"name": "Sch\u00f6nefelder Weg", "mid": [51.2900381, 7.100081]}, {"name": "Siemensstr", "mid": [51.2706641, 7.1225724]}, {"name": "Varresbecker Str", "mid": [51.2466083, 7.1070899]}, {"name": "Weidmannspfad", "mid": [51.2799429, 7.1193614]}, {"name": "Wildsteig", "mid": [51.279618, 7.1040139]}];

            function meterDist(a,b){
                var R = 6371000;
                var lat1=a[0]*Math.PI/180, lat2=b[0]*Math.PI/180;
                var dLat=(b[0]-a[0])*Math.PI/180, dLon=(b[1]-a[1])*Math.PI/180;
                var s=Math.sin(dLat/2)**2 + Math.cos(lat1)*Math.cos(lat2)*Math.sin(dLon/2)**2;
                return 2*R*Math.atan2(Math.sqrt(s), Math.sqrt(1-s));
            }

            function showNearestStreet() {
                if(!navigator.geolocation) return alert("Геолокация не поддерживается");

                navigator.geolocation.getCurrentPosition(function(pos){
                    var user=[pos.coords.latitude, pos.coords.longitude];
                    var best=null, bestDist=Infinity;

                    STREETS.forEach(s => {
                        if(!s.mid) return;
                        var d=meterDist(user, s.mid);
                        if(d<bestDist) { bestDist=d; best=s; }
                    });

                    if(!best) return alert("Не удалось найти ближайшую улицу");

                    // только popup, никакого рисования линий
                    L.marker(best.mid).addTo(MAP).bindPopup(
                        "Улица: <b>"+best.name+
                        "</b><br>Расстояние: "+Math.round(bestDist)+" м"
                    ).openPopup();

                    L.circleMarker(user, {
                        radius:6, color:'#000', fillColor:'#fff', weight:2
                    }).addTo(MAP).bindPopup("Вы здесь");

                    MAP.flyTo(best.mid, 16);
                },
                err => alert("Ошибка геопозиции: "+err.message),
                {enableHighAccuracy:true});
            }

            var b=document.createElement("button");
            b.textContent="Показать ближайшую улицу ко мне";
            b.style.position="absolute"; b.style.top="10px"; b.style.left="50%";
            b.style.transform="translateX(-50%)";
            b.style.zIndex=999999; b.style.padding="8px 12px";
            b.style.background="white"; b.style.border="1px solid #666";
            b.style.borderRadius="6px";
            b.onclick=showNearestStreet;
            document.body.appendChild(b);
        });
        </script>
